lrDataset.on('end', function () {
    console.log(dataset.length)
    console.log(labels.length)
    /* Generate foldsss */
    var fold1_dataset = [];
    var fold2_dataset = [];
    var fold3_dataset = [];
    var fold1_labels = [];
    var fold2_labels = [];
    var fold3_labels = [];
    var firstIndex = 0;
    var nrOfQueriesPerIntent = 0;
    var tempArrayPerIntent = [];
    var tempArrayPerLabel = [];
    for (var i = 0; i <= dataset.length; i++) {
        if (labels[i] == labels[firstIndex]) {
            nrOfQueriesPerIntent++;
            tempArrayPerIntent.push(dataset[i])
            tempArrayPerLabel.push(labels[i])
        }
        else {
            firstIndex = i--;
            var foldPerIntent = nrOfQueriesPerIntent / 3
            for (var begginIndex = 0; begginIndex < nrOfQueriesPerIntent; begginIndex++) {
                if (begginIndex < Math.trunc(foldPerIntent)) {
                    fold1_dataset.push(tempArrayPerIntent[begginIndex])
                    fold1_labels.push(tempArrayPerLabel[begginIndex])
                }
                else if (begginIndex < 2 * Math.trunc(foldPerIntent)) {
                    fold2_dataset.push(tempArrayPerIntent[begginIndex])
                    fold2_labels.push(tempArrayPerLabel[begginIndex])
                }
                else {
                    fold3_dataset.push(tempArrayPerIntent[begginIndex])
                    fold3_labels.push(tempArrayPerLabel[begginIndex])
                }
            }
            nrOfQueriesPerIntent = 0;
            tempArrayPerIntent = [];
            tempArrayPerLabel = [];
        }
    }

    fs.writeFile('First_fold.txt', fold1_dataset.join("\r\n"), (err) => {
        if (err) throw err;
    });

    fs.writeFile('Second_fold.txt', fold2_dataset.join("\r\n"), (err) => {
        if (err) throw err;
    });

    fs.writeFile('Third_fold.txt', fold3_dataset.join("\r\n"), (err) => {
        if (err) throw err;
    });

    fs.writeFile('First_fold_label.txt', fold1_labels.join("\r\n"), (err) => {
        if (err) throw err;
    });

    fs.writeFile('Second_fold_label.txt', fold2_labels.join("\r\n"), (err) => {
        if (err) throw err;
    });

    fs.writeFile('Third_fold_label.txt', fold3_labels.join("\r\n"), (err) => {
        if (err) throw err;
    });
});
